import { Container } from '@mui/system'
import TextField from '@mui/material/TextField'
import { Button } from '@mui/material';
import { useState } from 'react';
import { Link } from 'react-router-dom'
import { useNavigate } from 'react-router-dom';


function AddUser() {

  const [userData, setUserData] = useState({ firstName: String, lastName: String, username: String, sessionTimeOut: Number, createdData: new Date().toLocaleDateString('en-CA'), pepermissions: [] });


  return (
    <Container>
      <h3>Add New Users</h3>
      <TextField required label=" First Name" id="outlined-first-name" onChange={(e) => setUserData({ ...userData, firstName: e.target.value })} />
      <TextField required label=" Last Name" id="outlined-last-name" onChange={(e) => setUserData({ ...userData, lastName: e.target.value })} />
      <TextField required label=" User Name" id="outlined-last-name" onChange={(e) => setUserData({ ...userData, username: e.target.value })} />
      <TextField required label="Session Time Out" id="outlined-session-time-out" onChange={(e) => setUserData({ ...userData, sessionTimeOut: e.target.value })} />
    </Container>
  );
}

export default AddUser;
